import React, { Component } from 'react';
import {Nav,Table,Card,Row, Container}from 'react-bootstrap';
import '../../App.css';
/*
const StudentProfile = () => {

}
*/

class StudentProfile extends Component {
    //
    constructor(props) {
      super()
      this.state = {student: JSON.parse( sessionStorage.getItem('student')) }
      console.log(this.state)
    }

    render() {
        return (
          <Container>
              <Row>
      
                <Card >

                  <Card.Body style={{border:"none", top:'0px',bottom:'10px',width: '600px'}}>
                    <p>Name: {this.state.student.firstname}</p>
                    <p>Location: {this.state.student.location}</p>
                    <p>DOB: {this.state.student.dateofbirth}</p>
                    <p>Email: {this.state.student.email}</p>

                  </Card.Body>
                </Card>            
                
              </Row> 

            <h5>Tutoring Session Request</h5>
  </Container>

        );
    }
}

export default StudentProfile;
